  05> MACLEAN, Olivia Rachel
  b 30.07.1986
  Olivia b. at Hastings. She attended Cornwall Park School and is now at Remuera Intermediate.
  She plays the viola and enjoys netball and cross-country running.
  02> MACLEAN, Jillian Mary m on 08.11.1975 to DOHERTY, Paul Michael
  b 21.04.1951
  b 28.02.1950
  Jillian b, at Hastings and m, at Pukehou. Paul, s/o Jack and Doris Doherty, b, at Manly, NSW,
  Australia. Address: 18 Willowtree Close, Narara, Gosford 2250, NSW, Australia.
  Jillian was educated at Pukehou School and Woodford House where she was a school prefect. She
  became a NZ Registered Nurse at Auckland Hospital and was industrial nursing in London then was
  Sister in charge of social welfare at Ballarat Base Hospital, Australia. She worked as a sister at
  local Gosford hospitals on an on-call basis. She now has a wholesale plant nursery and works as a
  garden designer.
  Paul was educated at North Narrabeen Boys' High School where he was Senior Prefect. He is a civil
  engineer and is Operations Manager of the Waste Services Department with the Gosford City Council.
  He enjoys the beach, surf lifesaving and water sports as well as music and the outdoors.
  01> DOHERTY, Matthew James
  b 28.09.1978
  Matthew b. at Ballarat. He was educated at Niagara Park School where he was a vice sports
  house captain, and was then a foundation pupil at Narara Valley High School in Gosford. He is
  currently completing a degree in Landscape Management and Conservation at the University of
  Western Sydney, Hawkesbury, where his great-grandfather, Athol Williams, was an agricultural
  student in 1920. Matthew is an active member of the college community and a member of the
  Junior Common Room Committee. He enjoys adventurous sports and activities.
  02> DOHERTY, Claire Simone
  b 29.05.1980
  Claire b. at Ballarat. She was educated at Niagara Park School and currently attends Narara
  Valley High School in Gosford. She has a love for music and art and her adventurous spirit
  leads her to all outdoor sports including trekking, skydiving and abseiling. She has the Duke
  of Edinburgh Silver Medal.
  03> DOHERTY, Joanna Megan
  b 27.09.1982
  Joanna b. at Gosford. She was educated at Niagara Park School and is currently attending Narara
  Valley High School in Gosford. She is a successful sports person in the school community. Her
  swimming ability has taken her to representation in major swimming meets including Country and
  State competitions.
