  03> MACLEAN, Timothy Williams m on 09.07.1977 to DRUMMOND, Pamela Anne
  b 10.02.1953 d 09.11.1995
  b 02.11.1956
  Pamela, d/o Leonard Colin Drummond and Jean Emma Hansen. Address: (Pam) 5 St Hill Lane, Havelock
  North.
  Timothy was educated at Pukehou School, Hereworth School and Wanganui Collegiate School. After
  leaving school he did a diploma course at Lincoln University, working on farms in both the North
  and South Islands. He also gained his Trade Certificate in carpentry and commercial building.
  After his marriage to Pam he gained further experience working on farms as a shepherd. Paul and
  Kate were born during these years.
